// src/pages/ProductPage.js

import React from 'react';
import '../styles.css';
const ProductPage = () => {
    return (
        <div>
            <h1>Product Details</h1>
            <p>Here you can add the details of the product.</p>
        </div>
    );
};

export default ProductPage;
